import React from 'react';
import { AboutContainer } from '../styles/About.styled';
import face from './pic.jpeg';
import { Jumbotron } from '../styles/App.styled';

const About = () => {
    return (
        <>
        <Jumbotron>
        <h2>About Page</h2>
        </Jumbotron>
        <AboutContainer>
        <img src={face} alt="pic" />
        <p>Placeholder text</p>
</AboutContainer>
</>
);
}

export default About;
